import React from 'react';
import './SobreMim.css';
import Fundo from '../../assets/fundo.jpg';
import MoniseSilva from '../../assets/fotoCapa.jpg';


const SobreMim = () => {
    return (
        <section id="sobreMim" className="sobreMim">
            <img src={Fundo} alt="Fundo" className="fotoFundo"/>
            <h2>Sobre a Sites & Sistemas</h2>
            <div className="sobreMim-content">
                <div className="textoContainer">
                    <p>
                        A Sites & Sistemas transforma ideias em soluções digitais personalizadas para impulsionar negócios. Desenvolvemos sites únicos e sistemas personalizados que atendem às necessidades do cliente. Com tecnologia de ponta e uma abordagem cuidadosa, acompanhamos cada etapa do projeto para garantir um produto final moderno e funcional. Nossas soluções são feitas sob medida, com compromisso em gerar impacto real para o seu negócio. Quer inovar? Entre em contato para criar algo extraordinário!</p>


                </div>
                <div className="fotoContainer">
                    <img src={MoniseSilva} alt="Monise da Silva" className="fotoCapa"/>
                </div>
                </div>
        </section>
);
};

export default SobreMim;
